CREATE DATABASE IF NOT EXISTS `asopamo`;

USE `asopamo`;

SET foreign_key_checks = 0;

DROP TABLE IF EXISTS `cortes`;

CREATE TABLE `cortes` (
  `doc` varchar(20) NOT NULL,
  `dir` varchar(50) DEFAULT NULL,
  `p_nom` varchar(50) DEFAULT NULL,
  `p_ape` varchar(50) DEFAULT NULL,
  `estado` int(3) DEFAULT NULL,
  PRIMARY KEY (`doc`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS `deudas_meses`;

CREATE TABLE `deudas_meses` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_punto` int(10) NOT NULL,
  `fecha` date NOT NULL,
  `deuda` int(255) NOT NULL,
  `inter` int(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9567 DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS `ent_pago`;

CREATE TABLE `ent_pago` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Nombre` varchar(255) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;



DROP TABLE IF EXISTS `facturacion`;

CREATE TABLE `facturacion` (
  `numero_fact` int(11) NOT NULL AUTO_INCREMENT,
  `id_punto` int(11) DEFAULT NULL,
  `documento` int(20) DEFAULT NULL,
  `fecha_fact` date DEFAULT NULL,
  `periodo_fact` varchar(50) DEFAULT NULL,
  `admin_mes` decimal(60,0) DEFAULT NULL,
  `saldo_ant` decimal(60,0) DEFAULT NULL,
  `id_mes` varchar(15) DEFAULT NULL,
  `operador` varchar(255) DEFAULT NULL,
  `total_pagar` decimal(60,0) DEFAULT NULL,
  `dir` varchar(255) DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  `descuento` int(60) DEFAULT NULL,
  `matricula` int(11) DEFAULT NULL,
  `traslado` int(11) DEFAULT NULL,
  `reactivacion` int(11) DEFAULT NULL,
  `multa` int(11) DEFAULT NULL,
  `internet` int(10) NOT NULL,
  PRIMARY KEY (`numero_fact`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=21576 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

